import React from "react";

import '../styles/PersonalInfoBox.css'

function PersonalInfoBox ({psnInfo}) {

    return (
        <div className="psn-info-box">
            <img src={psnInfo.avaImg} className="profile-img"></img>
            <div className="psn-info">
                <p className="user-id">User id: <span className="value">{psnInfo.userID}</span></p>
                <p className="username">Username: <span className="psn-value">{psnInfo.username}</span></p>
                <p className="u-name">Name: <span className="value">{psnInfo.name}</span></p>
            </div>
        </div>
    );
}

export default PersonalInfoBox;
